import './form-input.style.scss'

const FormInput = ({ label, inputOptons }) => {
    return (
        <div className="group">
            <label className="from-input-label">{label} </label>

            <input className="form-input" {...inputOptons}>
            </input>
        </div>
    )
}

export default FormInput
